import styled from "styled-components";
import Title from "../../ui/title/title";
import {Ul} from "../../styled"

export const StyledTitle = styled(Title)`
    margin-bottom: 55px;
`;

export const StyledUl = styled(Ul)`
    display: flex;
    flex-wrap: wrap;
    gap: 30px;
    justify-content: center;
    margin-bottom: 120px;
`;
